<html>
<head>
  <meta charset=\"UTF-8\">
  <title>Rapport Taxi</title>
  <style>
    body {
      font-family: DejaVu Sans, sans-serif;
      margin: 30px;
      color: #333;
    }

    .header {
      text-align: center;
      margin-bottom: 30px;
    }

    .logo {
      width: 120px;
      height: auto;
      margin-bottom: 10px;
    }

    h1 {
      color: #222;
      font-size: 22px;
      margin-bottom: 10px;
    }

    h2 {
      color: #006699;
      font-size: 18px;
      border-bottom: 1px solid #aaa;
      padding-bottom: 4px;
      margin-top: 25px;
      margin-bottom: 12px;
    }

    table {
      width: 100%;
      border-collapse: collapse;
      margin-bottom: 20px;
      font-size: 12px;
    }

    th, td {
      border: 1px solid #bbb;
      padding: 8px;
      text-align: left;
    }

    th {
      background-color: #f0f0f0;
      color: #333;
    }

    tr:nth-child(even) {
      background-color: #f9f9f9;
    }

    .status {
      font-weight: bold;
      color: #fff;
      padding: 2px 6px;
      font-size: 11px;
    }

    .status-Completed { background-color: #4CAF50; }
    .status-Cancelled { background-color: #e53935; }
    .status-Pending   { background-color: #fb8c00; }
    .status-Ongoing   { background-color: #1e88e5; }

    .center {
      text-align: center;
    }
  </style>
</head>
<body>

<div class=\"header\">
<img src=\"data:image/png;base64,\" alt=\"Logo\" style=\"width: 120px; display: block; margin: 0 auto 20px auto;\">
 <h1>Rapport de l’utilisateur {{ user.name}} </h1>
</div>

<h2>Note moyenne par taxi</h2>
<table>
  <thead>
    <tr>
      <th>Immatriculation</th>
      <th>Marque</th>
      <th>Modèle</th>
      <th>Note Moyenne</th>
    </tr>
  </thead>
  <tbody>
    {% for row in ratings %}
      <tr>
        <td>{{ row.immatriculation }}</td>
        <td>{{ row.marque }}</td>
        <td>{{ row.modele }}</td>
        <td class=\"center\">{{ row.avgRating|number_format(2) }} / 5</td>
      </tr>
    {% else %}
      <tr><td colspan=\"4\" class=\"center\">Aucun rating disponible.</td></tr>
    {% endfor %}
  </tbody>
</table>

<h2>Top 5 taxis réservés</h2>
<table>
  <thead>
    <tr>
      <th>Immatriculation</th>
      <th>Marque</th>
      <th>Modèle</th>
      <th>Nombre de Réservations</th>
    </tr>
  </thead>
  <tbody>
    {% for row in topTaxis %}
      <tr>
        <td>{{ row.immatriculation }}</td>
        <td>{{ row.marque }}</td>
        <td>{{ row.modele }}</td>
        <td class=\"center\">{{ row.reservationsCount }}</td>
      </tr>
    {% else %}
      <tr><td colspan=\"4\" class=\"center\">Aucun taxi réservé.</td></tr>
    {% endfor %}
  </tbody>
</table>

<h2>Vos réservations détaillées</h2>
<table>
  <thead>
    <tr>
      <th>Date</th>
      <th>Départ</th>
      <th>Arrivée</th>
      <th>Distance (km)</th>
      <th>Montant</th>
      <th>Statut</th>
      <th>Taxi</th>
      <th>Chauffeur</th>
      <th>Votre Note</th>
    </tr>
  </thead>
  <tbody>
    {% for c in coursesData %}
      <tr>
        <td>{{ c.dateCourse|date('d/m/Y H:i') }}</td>
        <td>{{ c.villeDepart }}</td>
        <td>{{ c.villeArrivee }}</td>
        <td class=\"center\">{{ c.distanceKm }}</td>
        <td class=\"center\">{{ c.montant }} TND</td>
        <td><span class=\"status status-{{ c.statut }}\">{{ c.statut }}</span></td>
        <td>{{ c.immatriculation }} ({{ c.marque }} {{ c.modele }})</td>
        <td>{{ c.chauffeur }}</td>
        <td class=\"center\">{{ c.userRating is not null ? c.userRating ~ ' / 5' : 'N/A' }}</td>
      </tr>
    {% else %}
      <tr><td colspan=\"9\" class=\"center\">Aucune réservation.</td></tr>
    {% endfor %}
  </tbody>
</table>

</body>
</html>
